import React from "react";
import AboutPage from "./AboutPage";

function HomePage() {
  return (
    <>
      <div className="jumbotron">
        <h1>Ashray Chowdhry</h1>
        <p>Computer Science Student at Georgia Tech</p>
      </div>

      <a href="/about">About Page</a>
    </>
  );
}

export default HomePage;
